import React, { useState, useEffect } from 'react';
import { 
    Box, 
    Typography, 
    Card, 
    CardContent, 
    Button, 
    Grid,
    List,
    ListItem,
    ListItemText,
    Divider,
    CircularProgress
} from '@mui/material';
import { useNavigate } from 'react-router-dom';

function Business({ handleLogout }) {
    const navigate = useNavigate();
    const [loading, setLoading] = useState(true);
    const [configData, setConfigData] = useState(null);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchConfigData = async () => {
            try {
                // Get stored credentials
                const apiKey = localStorage.getItem('apiKey');
                const userId = localStorage.getItem('userId');
                const businessId = localStorage.getItem('businessId');
                const businessApiKey = localStorage.getItem('businessApiKey');

                if (!apiKey || !userId || !businessId || !businessApiKey) {
                    throw new Error('Missing configuration data');
                }

                setConfigData({
                    apiKey: apiKey,
                    userId: userId,
                    businessId: businessId,
                    businessApiKey: businessApiKey
                });
            } catch (err) {
                setError(err.message);
                console.error('Error fetching config:', err);
            } finally {
                setLoading(false);
            }
        };

        fetchConfigData();
    }, []);

    const handleLogoutClick = () => {
        handleLogout();
        navigate('/login');
    };

    const handleEditConfig = () => {
        navigate('/login');
    };

    if (loading) {
        return (
            <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
                <CircularProgress />
            </Box>
        );
    }

    if (error) {
        return (
            <Box sx={{ p: 3 }}>
                <Card>
                    <CardContent>
                        <Typography color="error" variant="h6">
                            Error: {error}
                        </Typography>
                        <Button 
                            variant="contained" 
                            color="primary" 
                            onClick={handleLogoutClick}
                            sx={{ mt: 2 }}
                        >
                            Return to Login
                        </Button>
                    </CardContent>
                </Card>
            </Box>
        );
    }

    return (
        <Box sx={{ p: 3 }}>
            <Grid container spacing={3}>
                <Grid item xs={12}>
                    <Card>
                        <CardContent>
                            <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
                                <Typography variant="h5">Business Dashboard</Typography>
                                <Box>
                                    <Button 
                                        variant="outlined" 
                                        color="primary" 
                                        onClick={handleEditConfig}
                                        sx={{ mr: 2 }}
                                    >
                                        Edit Configuration
                                    </Button>
                                    <Button 
                                        variant="outlined" 
                                        color="secondary" 
                                        onClick={handleLogoutClick}
                                    >
                                        Logout
                                    </Button>
                                </Box>
                            </Box>
                            <Divider sx={{ mb: 2 }} />
                            <Typography variant="body1" sx={{ mb: 2 }}>
                                Welcome to your business dashboard. Your configuration has been validated successfully.
                            </Typography>
                            <Typography variant="h6" sx={{ mt: 3, mb: 1 }}>
                                Current Configuration
                            </Typography>
                            <List>
                                <ListItem>
                                    <ListItemText 
                                        primary="API Key"
                                        secondary={configData?.apiKey ? `${configData.apiKey.substring(0, 8)}...` : 'Not set'}
                                    />
                                </ListItem>
                                <ListItem>
                                    <ListItemText 
                                        primary="User ID"
                                        secondary={configData?.userId || 'Not set'}
                                    />
                                </ListItem>
                                <ListItem>
                                    <ListItemText 
                                        primary="Business ID"
                                        secondary={configData?.businessId || 'Not set'}
                                    />
                                </ListItem>
                                <ListItem>
                                    <ListItemText 
                                        primary="Business API Key"
                                        secondary={configData?.businessApiKey ? `${configData.businessApiKey.substring(0, 8)}...` : 'Not set'}
                                    />
                                </ListItem>
                            </List>
                        </CardContent>
                    </Card>
                </Grid>
            </Grid>
        </Box>
    );
}

export default Business;
